import ModalApp from "./ModalApp";
import { useState } from "react";

const CerrarModal = () => {
  const [cerrar, setCerrar] = useState(true);
  const cerrarModal = () => {
    setCerrar(false);
  };

  return (
    <div className="overlay">
      <div className="popup">
        <i class="far fa-times-circle" onClick={cerrarModal}></i>
        {cerrar ? <ModalApp /> : null}
      </div>
    </div>
  );
};
export default CerrarModal;
